import React from 'react';

const UpcomingBills = ({ }) => {
  const bills = [
    { name: 'Electricity', amount: 100, dueDate: '2024-07-01' },
    { name: 'Internet', amount: 50, dueDate: '2024-07-05' },
  ];

  return (
    <div className="bills-container">
      <h2>Upcoming Bills</h2>
      <ul>
        {bills.map((bill, index) => (
          <li key={index}>
            {bill.name}: â‚¹{bill.amount} due on {bill.dueDate}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default UpcomingBills;
